import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import BannerProcess from '../components/Banner/PaymentBanner';
import EventFeatures from '../components/Process/EventFeatures';
import StartupFeatures from '../components/Process/StartupFeatures';
import Designtab from '../components/Process/Designtab';
import Paymentprocess from '../components/Paymentprocess';
import PaymentTestimonial from '../components/Process/PaymentTestimonial';


const Paymentprocessing = () => {
    return(
        <div className="body_wrapper">
            <OnepageMenu 
                    menu_txt1= "menu_txt1" 
                    menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" 
                    menu_txt6= "menu_txt6" menu_logo= "menu_logo" />  
            <BannerProcess 
                Title="Scrum Project Management" 
                TextD="Scrum is an agile development methodology used in the development of Software based on an iterative and incremental processes.  Scrum is adaptable, fast, flexible and effective agile framework that is designed to deliver value to the customer throughout the development of the project."/>            
            <EventFeatures/>
            
            <StartupFeatures/>

            <Designtab/>
        </div>
    )
}
export default Paymentprocessing;
